names = names.split(',')

def longest_prefix_name(names):
	_ = {}
	def foo(longest, name):
		x, count, s = _, 0, ''
		for i in xrange(len(name)):
			if name[i] in x:
				x, count, s = x[name[i]], count + 1, s + name[i]
			else:
				x[name[i]] = {}
				x = x[name[i]]
		return s if len(s) > len(longest) else longest
	return reduce(foo, names, '')

